import React  from 'react'
import ListData from '../data/clients1.json'

class List extends React.Component {
	render() {
		return(
			<div className="box-content">
				{
					ListData.map((clientsDetail ,clientsInfo ,indexs)=>{
					var j = 0; 
					var img = {
						backgroundImage: `url(${clientsDetail.general.avatar})`
					}
					console.log(clientsDetail)
					return(
						<div key={j} className="list">
							<div className="list-img" style={img}>
							</div>
							<div className="list_info">
								<div className="i_name">{clientsDetail.general.firstName}  {clientsDetail.general.lastName}</div>
								<div className="i_job">{clientsDetail.job.company}</div>
								<div className="i_job">{clientsDetail.job.title}</div>     
							</div>
						</div>
					)
					j++;
				})}
			</div>
		);
	}
}
export default List
